import React, { Fragment } from "react";
import { Link, Route } from "react-router-dom";

export default ({ writers }) => (
  <Fragment>
    <ul>
      {writers.map(({ id, name }) => (
        <li key={id}>
          <Link to="">name</Link>
        </li>
      ))}
    </ul>
  </Fragment>
);
